import React, { Component } from "react";
import Collapsible from "../components/collapsibles/Collapsible";
import { MyContext } from "../context";
import { NavMain, BtnTransparent } from "../styledComponents/StyledComps";
import * as Icon from "react-feather";

class NavBar extends Component {
  state = {
    heart: {
      name: "likedProducts"
    },
    user: {
      name: "info",
      name: "orden",
      name: "likes",
      name: "address",
      name: "logout"
    },
    shoppingCart: {
      name: "products"
    }
  };

  handleClick = e => {
    console.log("evento ", e);
  };
  render() {
    return (
      <MyContext.Consumer>
        {context => (

          <NavMain>
            <Collapsible items={[this.state]} open={context.open} />
            <h1 className="logo">MoMe</h1>
            <div className="main-nav-icons">
              <BtnTransparent
                onClick={() => {
                  this.handleClick()
                  context.toggleMenu()
                }}
              >
                <Icon.Heart icon={"heart"} size="24" color="white" />
              </BtnTransparent>
              <BtnTransparent
                onClick={() => {
                  this.handleClick()
                  context.toggleMenu()
                }}
              >
                <Icon.User icon={"user"} size="24" color="white" />
              </BtnTransparent>
              <BtnTransparent
                onClick={this.handleClick}
                onChange={context.toggleMenu}
              >
                <Icon.ShoppingCart
                  icon={"shoppingcart"}
                  size="24"
                  color="white"
                />
              </BtnTransparent>
            </div>
          </NavMain>
        )}
      </MyContext.Consumer>
    );
  }
}

export default NavBar;
